insert into hebergement values ('', 'Appartement', 'Italie','250', '4','Strada Provinciale Capalbio Capalbio, Toscane', '10','Au centre du village de Capalbio, dans la belle Toscane, offre à la vente des appartements lumineux larges au deuxième étage d\'un immeuble de seulement 4 unités, comprend: hall d\'entrée, grand salon avec balcon, cuisine, trois chambres , deux salles de bains et une buanderie. Remplissez la propriété d\'un garage de 25 mètres carrés.','http://pic.im-cdn.it/image/Appartamento_vendita_Capalbio_570539962.jpg');
insert into hebergement values ('', 'Maison', 'Italie','350', '5','Via Luigi Einaudi, 87,  Crespino', '9','Dans le centre-ville, nous avons de la famille caractérisée par de grands espaces libres sur trois côtés avec un grand possédé »se compose de: jardin séjour, cuisine, service, traitement, communication garage. A l\'étage, trois chambres et un service spacieux.','http://pic.im-cdn.it/image/Casa_indipendente_vendita_Crespino_570575608.jpg');